-- Reads the Database_POI table of elements to populate the Groups list
function AssembleGroupSorting_POI()
	if not (SONGMAN and GAMESTATE) then
        Warn("SONGMAN or GAMESTATE were not ready! Aborting!")
        return
    end
	
	MasterGroupsList = {}
	
	local numberOfMastergroupsBeforeAdding = #MasterGroupsList
	local playlistNames = GetPlaylistNames_POI()
	for i, thisPlaylistName in ipairs(playlistNames) do
		local thisPlaylistBanner = GetPlaylistBanner_POI(thisPlaylistName)
		local bannerPath = THEME:GetPathG("", thisPlaylistBanner)
		MasterGroupsList[#MasterGroupsList + 1] = {
			Name = thisPlaylistName,
			Banner = bannerPath,
			SubGroups = {}
		}
	end
	
	-- for each playlist hard-coded into POI,
	for i = numberOfMastergroupsBeforeAdding + 1, #MasterGroupsList do
		-- grabs name of the playlist we're currently working on
		local nameOfCurrentPlaylist = MasterGroupsList[i].Name
		-- grabs number of sublists this playlist possess
		local numberOfSublists = #GetPlaylistData_POI(nameOfCurrentPlaylist)
		-- for each sublist obtained related to that playlist, which were hard-coded into POI,
		for j = 1, numberOfSublists do
			-- grabs name of this sublist
			local nameOfCurrentSublist = GetPlaylistData_POI(nameOfCurrentPlaylist)[j][1]
			-- grabs sublist description
			local descriptionOfCurrentSublist = GetPlaylistData_POI(nameOfCurrentPlaylist)[j][3] -- not used lol
			-- grab an array of strings which is the list of songs allowed in
			local listOfAllowedSongsAsString = GetSongDirsFromSublist_POI(nameOfCurrentPlaylist, nameOfCurrentSublist)
			-- creates an array of Song objects that match the list of songs allowed in
			local arrayOfAllowedSongs = CreateSongArrayBasedOnList_POI(listOfAllowedSongsAsString)
			-- if and only if there are more than 0 allowed songs, create a subgroup with them
			if #arrayOfAllowedSongs > 0 then
				local thisSublistBanner = GetSublistBanner_POI(nameOfCurrentPlaylist, nameOfCurrentSublist)
				local bannerPath = THEME:GetPathG("", thisSublistBanner)
				table.insert(MasterGroupsList[i].SubGroups, #(MasterGroupsList[i].SubGroups) + 1, {
					Name = nameOfCurrentSublist,
					Banner = bannerPath,
					Songs = arrayOfAllowedSongs
					}
				)
			else end
		end
	end
	
end

function GetPlaylistNames_POI()	
    local playlistNames = {}
    for _, playlistData in ipairs(Database_POI()) do
        table.insert(playlistNames, playlistData[1])
    end
    return playlistNames
end

function GetPlaylistData_POI(input_playlistName)
    for _, thisPlaylistData in ipairs(Database_POI()) do
        if thisPlaylistData[1] == input_playlistName then
            -- Return the rest of the table related to the specified playlist name
            return { table.unpack(thisPlaylistData, 3) }
        end
    end
    -- If the specified playlist name is not found, return nil
    return nil
end

function GetSongDirsFromSublist_POI(input_playlistName, input_sublistName)
    for _, playlist in ipairs(Database_POI()) do
        if playlist[1] == input_playlistName then
            for i = 3, #playlist do
                if playlist[i][1] == input_sublistName then
                    local result = {}
                    for j = 3, #playlist[i] do
                        table.insert(result, playlist[i][j][1])
                    end
                    return result
                end
            end
        end
    end
    return nil
end

function CreateSongArrayBasedOnList_POI(input_listOfSongDirs)
    local allSongs = SONGMAN:GetAllSongs()
    local filteredSongs = {}
    
    -- Iterate through each directory in input_listOfSongDirs
    for _, dir in ipairs(input_listOfSongDirs) do
        -- Iterate through each song
        for _, song in ipairs(allSongs) do
            local songDir = song:GetSongDir()
            
            -- Check if the song directory matches the current directory in input_listOfSongDirs
            if songDir == dir then
                -- Add the song to filteredSongs
                table.insert(filteredSongs, song)
            end
        end
    end
    
    return filteredSongs
end

function GetSublistData_POI(input_playlistTable,input_sublistName)
	local output = {}
	
	-- Iterate over each sublist in the playlist table
    for _, sublist in ipairs(input_playlistTable) do
        -- Check if the sublist name matches the input sublist name
        if sublist[1] == input_sublistName then
            -- If there's a match, add the sublist data to the output
            for i = 3, #sublist do
                table.insert(output, sublist[i])
            end
            -- No need to continue searching if a match is found
            break
        end
    end
	
	return output
end

function GetChartsFromSublist_POI(input_sublistTable,input_songDir)
	local output = {}
	
	-- Iterate over each entry in the sublist table
    for _, songData in ipairs(input_sublistTable) do
        -- Check if the song directory matches the input song directory
        if songData[1] == input_songDir then
            -- If there's a match, add the charts to the output
            for i = 2, #songData do
                table.insert(output, songData[i])
            end
            -- No need to continue searching if a match is found
            break
        end
    end
	
	return output
end

-- inputs:
-- 1) a string related to the name of the group, such as |"Experience: Pump It Up Exceed 2"|
-- 2) an integer, related to the index of a song, such as |3|
-- returns: an array of strings, as in this example:
-- { "EXC2-NORMAL", "EXC2-HARD", "EXC2-CRAZY", "EXC2-FREESTYLE", "EXC2-NIGHTMARE" }
function GetAllowedChartsAsString_POI(input_groupName,input_currentIndex)

	local output

	local thisSublist = GetGroupData_POI(input_groupName)
		
	-- Get the desired sublist based on the current index
	output = thisSublist[input_currentIndex]
	-- Remove the first item (the song path) from the result
    output = { table.unpack(output, 2) }
		
	return output
end

-- inputs:
-- 1) a string related to the name of the group, such as |"Experience: Pump It Up Exceed 2"|
-- 2) an integer, related to the index of a song, such as |3|
-- returns: an array of Chart objects, as in this example:
-- { [Object for a "EXC2-NORMAL" chart], [Object for a "EXC2-HARD" chart], [Object for a "EXC2-CRAZY" chart] }
function GetAllowedCharts_POI(input_chartArray, input_groupName, input_currentIndex)
	local output = {}

	if input_groupName == "Problematic songs" or input_groupName == "All Tunes" then
		output = input_chartArray
	else
		local listOfAllowedChartsAsString = GetAllowedChartsAsString_POI(input_groupName, input_currentIndex)
		output = CreateChartArrayBasedOnList_POI(input_chartArray, listOfAllowedChartsAsString)
	end
	return output
end

-- input: is a string, related to the name of a group, like "Experience: Pump It Up Exceed 2"
-- returns: an array of arrays of strings, as in this example:
-- { 	
--    { "/Songs/POI-database/B16 - J BONG/", "EXC2-NORMAL", "EXC2-HARD", "EXC2-CRAZY", "EXC2-FREESTYLE", "EXC2-NIGHTMARE", },
--    { "/Songs/POI-database/B17 - HI-BI/", "EXC2-NORMAL", "EXC2-HARD", "EXC2-CRAZY", "EXC2-FREESTYLE", "EXC2-NIGHTMARE", },
-- }
function GetGroupData_POI(input_groupName_as_string)

	-- for every group listed in New_Database_POI,
	for _, thisGroupData in ipairs(New_Database_POI()) do
		-- if the first element matches the input of this function,
		if thisGroupData[1] == input_groupName_as_string then
			-- then return the rest of the group related to that specific group name,
			-- but ignore the 3 first fields (the name, banner, and description of the group)
			return { table.unpack(thisGroupData, 4) }
		end
	end
	-- If the specified playlist name is not found, return nil
	return nil

end

function CreateChartArrayBasedOnList_POI(input_ChartArray, input_allowedCharts)
	local output_ChartArray = {}

    for _, chart in ipairs(input_ChartArray) do
        local description = chart:GetDescription()
        
        for _, allowedChart in ipairs(input_allowedCharts) do
            if description == allowedChart then
                table.insert(output_ChartArray, chart)
                break  -- No need to continue checking if the chart has been added
            end
        end
    end

    return output_ChartArray
end

function FilterChartFromSublist_POI(input_CurGroupName,input_CurrentIndex,input_ChartArray)
	-- declares our output
	local outputChartArray = input_ChartArray
	
	-- don't use any logic if the group name is "All Tunes"
	if input_CurGroupName == "Problematic songs" or input_CurGroupName == "All Tunes" then
		return input_ChartArray
	end
	
	-- grabs an array of strings, representing the charts that are allowed to be displayed considering this Sublist name, and this MusicWheel SongIndex
	local listOfAllowedChartsAsString = GetAllowedChartsAsString_POI(input_CurGroupName,input_CurrentIndex)
	
	-- creates an array of Chart objects that match the list of charts allowed in
	outputChartArray = CreateChartArrayBasedOnList_POI(input_ChartArray, listOfAllowedChartsAsString)
	
	-- checks if outputChartArray was left empty
	if #outputChartArray == 0 then
		return {} -- this will make the function return an empty ChartArray, and ChartDisplay.lua will repopulate it with all possible charts for this song "to avoid other crashes" in their words
	end
	
	return outputChartArray
end

-- inputs:
-- 1) a song object
-- 2) a string detailing what you want, from this list:
-- "First Tag", "Second Tag", "Song Category", "Display-formatted Song Category", "Display-formatted Song Genre", "Minimalist Song Genre"
-- "Song Display BPMs"
-- "Song Origin Color", "Song Genre Color", "Song Category Color"
-- returns:
-- it actually depends on what you want, really
function FetchFromSong(input_song, fetch_details)
	
	local output = ""

	if fetch_details == "First Tag" then
		-- returns a string
		
		local fullTagAttribute = input_song:GetTags()
		if fullTagAttribute ~= "" then
			local words = {} -- array of strings, one for each separate word
			for thisWord in fullTagAttribute:gmatch("%S+") do
				table.insert(words, thisWord)
			end
		output = words[1] -- gets the first word in that array
		end
	
	elseif fetch_details == "Second Tag" then
		-- returns a string
		
		local fullTagAttribute = input_song:GetTags()
		if fullTagAttribute ~= "" then
			local words = {} -- array of strings, one for each separate word
			for thisWord in fullTagAttribute:gmatch("%S+") do
				table.insert(words, thisWord)
			end
			
			-- Check if the words table has more than one element
			if #words >= 2 then
				output = words[2] -- gets the second word in that array		
			end
		end
	
	elseif fetch_details == "Song Category" then
		-- returns a string
		
		local song_firstTag = FetchFromSong(input_song, "First Tag")
		local song_secondTag = FetchFromSong(input_song, "Second Tag")
		if song_firstTag == "SHORTCUT" then	output = "SHORTCUT"
		elseif song_firstTag == "REMIX" then output = "REMIX"
		elseif song_firstTag == "FULLSONG" then	output = "FULLSONG"
		elseif song_secondTag == "ANOTHER" then	output = "ANOTHER"
		else output = "ARCADE"
		end

	elseif fetch_details == "Display-formatted Song Category" then
		-- returns a string

		local song_firstTag = FetchFromSong(input_song, "First Tag")
		local song_secondTag = FetchFromSong(input_song, "Second Tag")
		if song_firstTag == "SHORTCUT" then	output = "- SHORT CUT -"
		elseif song_firstTag == "REMIX" then output = "- REMIX -"
		elseif song_firstTag == "FULLSONG" then	output = "- FULL SONG -"
		elseif song_secondTag == "ANOTHER" then	output = "- ANOTHER -"
		else output = ""
		end

	elseif fetch_details == "Display-formatted Song Genre" then
		-- returns a string

		if input_song:GetGenre() == "KPOP" then output = "K-Pop"
		elseif input_song:GetGenre() == "ORIGINAL" then output = "PIU Originals"
		elseif input_song:GetGenre() == "WORLDMUSIC" then output = "World Music"
		else output = input_song:GetGenre()
		end

	elseif fetch_details == "Minimalist Song Genre" then
		-- returns a string

		if input_song:GetGenre() == "KPOP" then output = "K"
		elseif input_song:GetGenre() == "ORIGINAL" then output = "O"
		elseif input_song:GetGenre() == "WORLDMUSIC" then output = "W"
		else output = input_song:GetGenre()
		end

	elseif fetch_details == "Song Display BPMs" then
		-- returns a string

		local bpm_raw = input_song:GetDisplayBpms()
		local bpm_low = math.ceil(bpm_raw[1])
		local bpm_high = math.ceil(bpm_raw[2])
		local bpm_display = (bpm_low == bpm_high and bpm_high or bpm_low .. "-" .. bpm_high)
		output = bpm_display .. " BPM"

	elseif fetch_details == "Song Origin Color" then
		-- returns a color object, such to use inside a self:diffuse(x)

		output = GetColor_POI(input_song:GetOrigin())
	
	elseif fetch_details == "Song Genre Color" then
		-- returns a color object, such to use inside a self:diffuse(x)

		output = GetColor_POI(input_song:GetGenre())
	
	elseif fetch_details == "Song Category Color" then
		-- returns a color object, such to use inside a self:diffuse(x)
		
		local song_firstTag = FetchFromSong(input_song, "First Tag")
		local song_secondTag = FetchFromSong(input_song, "Second Tag")
		if song_firstTag == "SHORTCUT" or song_firstTag == "REMIX" or song_firstTag == "FULLSONG" then
			output = GetColor_POI(song_firstTag)
		elseif song_secondTag == "ANOTHER" then
			output = GetColor_POI(song_secondTag)
		else
			output = GetColor_POI("ARCADE")
		end
	end

	return output

end

-- inputs:
-- 1) a chart object
-- 2) a string detailing what you want, from this list:
-- "Chart POI Name", "Chart Origin", "Chart Meter"
-- "Chart Stepstype Color"
-- returns:
-- it actually depends on what you want, really
function FetchFromChart(input_chart, fetch_details)
	
	local output = ""

	if fetch_details == "Chart POI Name" then
		-- returns a string

		local chartFullChartnameFromSSC = input_chart:GetChartName()
		local openParen = chartFullChartnameFromSSC:find("%(")
		output = chartFullChartnameFromSSC:sub(1, openParen - 2)
	elseif fetch_details == "Chart Origin" then
		-- returns a string

		local chartFullChartnameFromSSC = input_chart:GetChartName()
		local openParen = chartFullChartnameFromSSC:find("%(")
		local closeParen = chartFullChartnameFromSSC:find("%)")
		output = chartFullChartnameFromSSC:sub(openParen + 1, closeParen - 1)

	elseif fetch_details == "Chart Meter" then
		-- returns a string

		local originalChartMeter = input_chart:GetMeter()
		if originalChartMeter == 99 then output = "??"
		else output = string.format("%02d", originalChartMeter)
		end

	elseif fetch_details == "Chart Author" then
		-- returns a string
		
		if (input_chart:GetAuthorCredit() == "") then output = "Author is blank"
		else output = input_chart:GetAuthorCredit() end

	elseif fetch_details == "Chart Level" then
		-- returns a string
		
		if input_chart:GetMeter() == 99 then output = "??"
		else output = string.format("%02d", input_chart:GetMeter()) end

	elseif fetch_details == "Chart Stepstype Color" then
		-- returns a color object, such to use inside a self:diffuse(x)

		if FetchFromChart(input_chart, "Chart POI Name"):sub(1, 3) == "IDK" then
			output = GetColor_POI("IDK")
		elseif input_chart:GetAuthorCredit() == "Placeholder" then
			output = GetColor_POI("Placeholder")
		else 
			output = GetColor_POI(ToEnumShortString(ToEnumShortString(input_chart:GetStepsType())))
		end

	end

	return output

end

function GetPlaylistBanner_POI(input_playlistName)
	local output = "Common fallback banner" -- handle the case where the input string doesn't have a corresponding playlist
	
	for _, playlistData in ipairs(Database_POI()) do
		if playlistData[1] == input_playlistName then
			output = playlistData[2] -- return the playlist banner path if found
		end
	end
	
	return output
end

function GetSublistBanner_POI(input_playlistName, input_sublistName)
	local output = "Common fallback banner" -- handle the case where the input strings doesn't have a corresponding playlist and/or sublist
	
	for _, playlistData in ipairs(Database_POI()) do
		if playlistData[1] == input_playlistName then
			for _, sublistData in ipairs(playlistData) do
				if type(sublistData) == "table" and sublistData[1] == input_sublistName then
					output = sublistData[2]
					break -- exit the loop once the sublist is found
				end
			end
			break -- exit the loop once the playlist is found
		end
	end
	
	return output
end

function FormatDate_POI(input_date_as_string)	
	local output = ""
	
	-- Split the input string based on the hyphen separator
	local parts = string.split(input_date_as_string, "-")
	
	-- Assign each part to the corresponding variable
	local YearAsString = parts[1] or ""
	local MonthAsNumberString = parts[2] or ""
	local DayAsNumberString = parts[3] or ""
	
	-- Format the month
	local MonthAsString = ""
	local monthMap = {
		["01"] = "Jan", ["02"] = "Feb", ["03"] = "Mar", ["04"] = "Apr", ["05"] = "May", ["06"] = "Jun", 
		["07"] = "Jul", ["08"] = "Aug", ["09"] = "Sep", ["10"] = "Oct", ["11"] = "Nov", ["12"] = "Dec"
	}
	MonthAsString = monthMap[MonthAsNumberString] or ""
	
	-- Creates output
	output = YearAsString .. ", " .. DayAsNumberString .. " " .. MonthAsString
	
	return output
end

