   			if not (chartPOIName == "HALF-DOUBLE" or chartPOIName == "HALF-DOUBLE i" or chartPOIName == "HALF-DOUBLE ii" or chartPOIName == "HALF-DOUBLE iii") then
				table.remove(output, i)
