   			if not (chartPOIName == "NIGHTMARE" or chartPOIName == "NIGHTMARE i" or chartPOIName == "NIGHTMARE ii" or chartPOIName == "NIGHTMARE iii"
			or chartPOIName == "EXTRA EXPERT DOUBLE") then
				table.remove(output, i)
			end
		end
	end

	return output
end

-- input: is a string, related to the name of a group, like "Experience: Pump It Up Exceed 2"
-- returns: an integer, related to the total number of songs in that group
function GetNumberOfSongsFromGroup_POI(input_groupName_as_string)
	local output = 0
	local arrayOfSongs

	-- for every group listed in New_Database_POI,
	for _, thisGroupData in ipairs(New_Database_POI()) do
		-- if the first element matches the input of this function,
		if thisGroupData[1] == input_groupName_as_string then
			-- then fetches the rest of the group related to that specific group name,
			-- but ignore the 3 first fields (the name, banner, and description of the group)
			arrayOfSongs = { table.unpack(thisGroupData, 4) }
			output = #arrayOfSongs
		end
	end

	return output
end